import React from 'react';
import axios from "axios";
import {connect} from "react-redux";


class Admin extends React.Component{
    constructor(props){
        super(props);

        this.state = {
            list:[]
        }
    }

    async componentDidMount(){
        let datas = await this.props.datas;
        let list =  datas.map((value, index) => { 
            return (<tr key={index}><th>{value.id}</th><th>{value.mail}</th><td><button>Modifier</button></td></tr>)})
        this.setState({list:list})
    }


    render(){
        console.log()
        return(
            <table>
                <tbody>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                    </tr>
                    {this.state.list}
                </tbody>
            </table>
                

        )
    }
}

function mapStateToProps(state){
    return {
      datas: state.reducer,
    };
  }
  export default connect(mapStateToProps)(Admin);
